import "./Header.css";
import { ArrowLeftOutlined, HomeFilled } from "@ant-design/icons";

function Header() {
    return (
        <>
            <div className="header">
                <ArrowLeftOutlined />
                <HomeFilled />
            </div>

        </>
    );
}

export default Header;
